import React from 'react';
import {Inner} from './styles/jumbotron'

// eslint-disable-next-line no-empty-pattern
export default function Jumbotron({ direction='row'}) {
    return (
        <Inner direction=''>
            <p>Hello from Jumbotron</p>
        </Inner>
    )
}
